* Number of blue jellybeans: b
* Number of red jellybeans: r
* Total number of jellybeans: 60

We know that there are 2x as many red jellybeans as green jellybeans, so we can write an equation:

r = 2(17) = 34

We also know that the sum of all the jellybeans is 60, so we can set up another equation:

b + 17 + 34 = 60

Combine like terms:

b + 51 = 60

Subtract 51 from both sides:

b = 9

So, there are 9 blue jellybeans.

Answer: 9

