Twenty tourists discovered 700 shells in a strip mall parking lot. They had divided into three groups, Alphas, The finders, and Gogetters to find as many shells as possible. If team Alphas found 40% of the shells, and team The finders found 60% of the remaining shells, how many shells did team Gogetters find? Please provide the initial step towards resolving the question. This step may serve as a foundation but might not encompass the entire solution.

assistant

Step 1: Calculate the number of shells left after team Alphas finds their share.
Team Alphas finds 40% of 700 shells, which is:
0.4 x 700 = 280 shells
So, there are 700 - 280 = 420 shells left.

Step 2: Calculate the number shells left for team The Finders.
Team The Finders finds 60% of 420 shells, which is:

0.6 x 420 = 252 shells
So, they leave 420 - 252 = 168 shells for team Gogetters.

Answer: Team Gogetters finds 168 shells.

